import React, { useRef } from "react";
import emailjs from "@emailjs/browser";
import { Card, Container } from "react-bootstrap";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const ContactUs = () => {
  const form = useRef();

  const sendEmail = (e) => {
    e.preventDefault();

    emailjs
      .sendForm(
        "YOUR_SERVICE_ID",
        "YOUR_TEMPLATE_ID",
        form.current,
        "YOUR_PUBLIC_KEY"
      )
      .then(
        (result) => {
          console.log(result.text);
        },
        (error) => {
          console.log(error.text);
        }
      );
  };

  return (
    <React.Fragment>
      <div>
        <h1 style={{ marginTop: "50px", textAlign: "center" }}> Contact Me</h1>
        <hr
          style={{
            height: "3px",
            color: "#ffbb00",
            backgroundColor: "#ffbb00",
            width: "60%",
            marginLeft: "auto",
            marginRight: "auto",
          }}
        />
      </div>
      <Container>
        <Row>
          <Col>
            <Card
              style={{
                width: "30rem",
                height: "30rem",
                marginLeft: "100px",
                marginTop: "100px",
              }}
            >
              <Card.Body>
                <Form onSubmit={emailSender} ref={form}>
                  <Form.Group controlId="name">
                    <Form.Label>Name</Form.Label>
                    <Form.Control
                      type="text"
                      placeholder="Your Name"
                      required
                      name="name"
                      onBlur={handleForm}
                    />
                  </Form.Group>
                  <Form.Group className="mb-3" controlId="formBasicEmail">
                    <Form.Label>Email address</Form.Label>
                    <Form.Control
                      required
                      name="email"
                      type="email"
                      placeholder="Enter email"
                      onBlur={handleForm}
                    />
                    <Form.Text className="text-muted"></Form.Text>
                  </Form.Group>
                  <Form.Group className="mb-3" controlId="message">
                    <Form.Label>Message</Form.Label>
                    <Form.Control
                      required
                      name="message"
                      type="text"
                      placeholder="Type Your Message"
                      as="textarea"
                      rows={3}
                      onBlur={handleForm}
                    ></Form.Control>
                  </Form.Group>

                  {contactMessage && <p>{contactMessage}</p>}

                  <Button
                    style={{ marginLeft: "170px", marginTop: "40px" }}
                    variant="warning"
                    type="submit"
                    size="lg"
                  >
                    Submit
                  </Button>
                </Form>
              </Card.Body>
            </Card>
          </Col>

          <Col>
            <h1 style={{ marginLeft: "200px", marginTop: "100px" }}>
              Contact Info
            </h1>
            <hr
              style={{
                height: "3px",
                color: "#ffbb00",
                backgroundColor: "#ffbb00",
                width: "60%",
                marginLeft: "auto",
                marginRight: "auto",
              }}
            />
            <div style={{ marginLeft: "90px" }}>
              <IconContext.Provider value={{ color: "#ffbb00", size: "2em" }}>
                <div>
                  <a
                    style={{ color: "black" }}
                    href="mailto:l.cvengros@icloud.com"
                  >
                    <h3
                      style={{
                        marginLeft: "10px",
                        marginTop: "50px",
                        color: "black",
                      }}
                    >
                      {" "}
                      <FaEnvelope /> L.Cvengros@icloud.com
                    </h3>
                  </a>
                </div>
                <div>
                  <a
                    style={{ color: "black" }}
                    href="https://github.com/Laurencvengros"
                  >
                    <h3
                      style={{
                        marginLeft: "10px",
                        marginTop: "50px",
                        color: "black",
                      }}
                    >
                      {" "}
                      <FaGithub /> Laurencvengros
                    </h3>
                  </a>
                </div>
                <div>
                  <a
                    style={{ color: "black" }}
                    href="https://www.linkedin.com/in/lauren-cvengros-a00957249/"
                  >
                    <h3
                      style={{
                        marginLeft: "10px",
                        marginTop: "50px",
                        color: "black",
                      }}
                    >
                      {" "}
                      <FaLinkedin /> lauren-cvengros-a00957249
                    </h3>
                  </a>
                </div>
              </IconContext.Provider>
            </div>
          </Col>
        </Row>
      </Container>
    </React.Fragment>
  );
};
//

export default ContactUs;
